        const daysDiff = Math.floor((checkDate.getTime() - logDate.getTime()) / (1000 * 60 * 60 * 24));
        if (daysDiff > 1) break; // Gap in dates
        if (log.status === "completed") {
            currentStreak++;
            checkDate = logDate;
        } else if (log.status === "failed") {
            break;
        }
